import React, { Fragment } from "react";

const AvailableMeals = () => {
  return (
    <Fragment>
      <ul>
        <li>
          <div>Sushi - 10</div>
          <button>Add</button>
        </li>
        <li>
          <div>Scnitzel - 5</div>
          <button>Add</button>
        </li>
        <li>
          <div>Burger - 7</div>
          <button>Add</button>
        </li>
      </ul>
      <button>Add</button>
    </Fragment>
  );
};
export default AvailableMeals;
